import React from 'react' 


function Home() {
  return (
    <div className="navBar">
      <h1 className="glitch-title">
        {/* Normal, non-glitching text */}
        <span>Gde sad</span>
        {/* The glitching layer */}
        <div className="glitch" aria-hidden="true">
          <span>Gde sad</span>
        </div>
      </h1>
    </div>
  );
}

export default Home;
